import { useHistory } from "react-router-dom";
import DeckList from "./DeckList";


export default function Home ({decks}) {
    const history = useHistory()
    if(decks) {
        console.log(decks)
        return (
            <>
            <button type="button" name="create-deck" onClick={() => useHistory.push("/decks/new")}>+Create New Deck</button>
            <div>
                <DeckList decks={decks} />
            </div>
            </>
        )
    }
    return <p>Loading...</p>
}
